(1, '1542609437_volvoFH16xxx63_1519130717.jpg', 'All trucks with Volvo FH 750hp engine', 'Все грузовики с двигателем 750л.с. от Volvo FH', 'Once you installed the mod, go to any truck dealer and find there a 750hp truck', 'После установки мода, необходимо посетить любого автодиллера и найти там нужный грузовик с уже установленным двигателем на 750 л.с.', '1543409962_All_trucks_with_Volvo_FH_750hp_engine.scs', '1.33', NULL, 1, 1, 'ets2', '2018-11-19 04:37:17', '2018-11-28 11:28:23'),
(2, '1543410119_43-in-studio-13062-002m2_1527582553.jpg', 'All trucks with Scania S 730hp engine', 'Все грузовики с двигателем 730л.с. от Scania S', 'Once you installed the mod, go to any truck dealer and find there a 730hp truck', 'После установки мода, необходимо посетить любого автодиллера и найти там нужный грузовик с уже установленным двигателем на 730 л.с.', '1543410119_All_trucks_with_Scania_S_730hp_engine.scs', '1.33', NULL, 1, 2, 'ets2', '2018-11-28 11:01:59', '2018-11-28 11:28:13'),
(3, '1543411522_C10399679_1519130673.jpg', 'All trucks with 625hp Caterpillar C15', 'Все грузовики с двигателем 625л.с. Caterpillar C15', 'Once you installed the mod, go to any truck dealer and find there a 625hp truck', 'После установки мода, необходимо посетить любого автодиллера и найти там нужный грузовик с уже установленным двигателем на 625 л.с.', '1543411523_All_trucks_with_625hp_Caterpillar_C15.scs', '1.33', NULL, 1, 3, 'ats', '2018-11-28 11:25:23', '2018-11-28 11:26:02'),
(4, '1543412755_17.jpg', 'Black grill for Volvo FH 2012', 'Черная решетка на новую Volvo', 'This mod makes black grill default for all of Volvo FH engines.\r\n(Do not change anything on the truck in MP, otherwise grill will reset)', 'Этот мод делает чёрную решетку дефолтной для всех двигателей Volvo FH.\r\n(В мультиплеере после замены любой детали грузовика в сервисе, решетка заменится на стандартную)', '1543412755_Black_grill_for_Volvo_FH_2012.scs', '1.33', NULL, 1, 4, 'ets2', '2018-11-28 11:45:55', '2018-11-28 11:48:50');
